@border:    Si že sam ugotovil, da je to to.

@LooK:    To vprašanje se je pojavilo že XX - krat, malo bi bilo treba pobrskati po forumu, vendar je verjetno najlažje samo vprašati, namesto, da bi se malo potrudili.
Torej, v Mapsourcu označiš Adria Route, nato iz menija izbereš drugo karto in zopet označiš dele iz te karte. Na zavihku zemlejvidi vidiš katere dele si označil in koliko bo velikost datoteke. Ko izbereš vse kar želiš imeti, skreiraš karto in glej ga zlomka, vse karte bojo v tej eni datoteki.

Z Garminove strani prenesi topografsko karto, jo instaliraj na PC in z mapsourcom prenesi na nokio
